INSERT INTO `tm_questions` VALUES (1, 1, '1. Apakah organisasi (Kementerian/Lembaga/Pemda) telah memiliki Aturan Perilaku (Kode Etik) yang ditetapkan secara formal oleh pimpinan organisasi?', 1, '2024-05-28 15:56:55', '2024-06-07 14:41:25');
INSERT INTO `tm_questions` VALUES (2, 1, '2. Apakah Aturan Perilaku organisasi tersebut telah dikomunikasikan kepada seluruh pegawai dalam unit kerja/unit organisasi Saudara?', 1, '2024-05-28 15:57:04', '2024-06-07 14:41:39');
INSERT INTO `tm_questions` VALUES (3, 1, '3. Apakah seluruh pegawai dalam unit kerja/unit organisasi Saudara berperilaku sesuai dengan kode etik organisasi, dan atas setiap pelanggaran aturan perilaku telah dilakukan tindakan disiplin?', 1, '2024-05-28 15:57:41', '2024-06-07 14:41:51');
INSERT INTO `tm_questions` VALUES (4, 1, '4. Apakah pimpinan organisasi/unit-organisasi/unit kerja telah melakukan pemantauan/evaluasi secara berkala dan didokumentasikan atas penerapan Aturan Perilaku, termasuk penegakan disiplin atas pelanggaran Aturan perilaku?', 0, '2024-05-28 15:57:41', '2024-06-07 14:42:06');
INSERT INTO `tm_questions` VALUES (5, 1, '5. Apakah aturan perilaku (kode etik) organisasi dikembangkan terus menerus sesuai perubahan yang terjadi, dan telah dilakukan pemantauan otomatis oleh pimpinan organisasi atas penerapan aturan perilaku organisasi?', 0, '2024-05-28 15:57:41', '2024-06-07 14:42:24');
INSERT INTO `tm_questions` VALUES (6, 2, '1. Apakah organisasi telah memiliki standar kompetensi untuk seluruh jabatan dan uraian tugas untuk seluruh jabatan yang ditetapkan secara formal oleh pimpinan organisasi?', 1, '2024-05-30 18:20:16', '2024-06-07 14:42:37');
INSERT INTO `tm_questions` VALUES (7, 2, '2. Apakah standar kompetensi jabatan dan uraian tugas jabatan tersebut telah dikomunikasikan kepada seluruh pegawai dalam unit kerja/unit organisasi Saudara?', 1, '2024-05-30 18:20:16', '2024-06-07 14:42:48');
INSERT INTO `tm_questions` VALUES (8, 2, '3. Apakah mayoritas promosi/mutasi pejabat struktural telah berdasarkan standar kompetensi jabatan?', 1, '2024-05-30 18:20:16', '2024-06-07 14:42:59');
INSERT INTO `tm_questions` VALUES (9, 2, '4. Apakah pimpinan organisasi/unit organisasi telah melakukan pemantauan/evaluasi secara berkala dan didokumentasikan atas standar kompetensi jabatan dan kesesuaian penempatan pejabat struktural dengan standar kompetensi?', 0, '2024-05-30 18:20:16', '2024-06-07 14:43:31');
INSERT INTO `tm_questions` VALUES (10, 2, '5. Apakah standar kompetensi pegawai dikembangkan terus menerus sesuai perubahan yang terjadi, dan ada sarana pemantauan secara otomatis/online oleh pimpinan organisasi/unit organisasi atas kesesuaian penempatan pejabat struktural dengan standar kompetensi?', 0, '2024-05-30 18:20:16', '2024-06-07 14:43:41');
INSERT INTO `tm_questions` VALUES (11, 3, '1. Apakah organisasi telah memiliki  kebijakan/prosedur Sistem Manajemen Kinerja (SMK), misalnya prosedur penerapan Sistem Akuntabilitas Kinerja Instansi Pemerintah (SAKIP)?', 1, '2024-06-04 14:38:43', '2024-06-07 14:44:14');
INSERT INTO `tm_questions` VALUES (12, 3, '2. Apakah kebijakan/prosedur SMK  telah dikomunikasikan kepada seluruh tingkat pimpinan dalam unit organisasi/unit kerja Saudara?', 1, '2024-06-04 14:38:43', '2024-06-07 14:44:27');
INSERT INTO `tm_questions` VALUES (13, 3, '3. Apakah kebijakan/prosedur SMK telah diberlakukan/diimplementasikan kepada unit kerja/unit organisasi Saudara?', 1, '2024-06-04 14:38:43', '2024-06-07 14:44:38');
INSERT INTO `tm_questions` VALUES (14, 3, '4. Apakah pimpinan organisasi / unit-organisasi / unit kerja telah mengevaluasi kebijakan/prosedur SMK dan implementasinya secara berkala dan didokumentasikan?', 0, '2024-06-04 14:38:43', '2024-06-07 14:44:47');
INSERT INTO `tm_questions` VALUES (15, 3, '5. Apakah kebijakan/prosedur SMK dikembangkan terus menerus sesuai dengan perubahan yang terjadi dan telah dilakukan pemantauan otomatis/online oleh pimpinan organisasi ?', 0, '2024-06-04 14:38:43', '2024-06-07 14:44:59');
INSERT INTO `tm_questions` VALUES (16, 4, '1. Apakah organisasi/ unit-organisasi/ unit kerja Saudara telah memiliki Struktur Organisasi beserta uraian tata laksananya mengacu pada peraturan perundang-undangan yang berlaku?', 1, '2024-06-07 14:45:21', '2024-06-07 14:45:21');
INSERT INTO `tm_questions` VALUES (17, 4, '2. Apakah keberadaan Struktur Organisasi, baik pada organisasi/ unit-organisasi/ unit kerja, telah dikomunikasikan kepada seluruh level pimpinan dan pegawai?', 1, '2024-06-07 14:45:35', '2024-06-07 14:45:35');
INSERT INTO `tm_questions` VALUES (18, 4, '3. Apakah struktur organisasi pada organisasi / unit-organisasi / unit kerja Saudara telah sesuai dengan ukuran dan sifat kegiatannya?', 1, '2024-06-07 14:45:43', '2024-06-07 14:45:43');
INSERT INTO `tm_questions` VALUES (19, 4, '4. Apakah struktur organisasi pada organisasi / unit-organisasi / unit kerja Saudara telah dievaluasi secara periodik dan didokumentasikan?', 0, '2024-06-07 14:45:55', '2024-06-07 14:45:55');
INSERT INTO `tm_questions` VALUES (20, 4, '5. Apakah struktur organisasi dimutakhirkan secara terus menerus sesuai perubahan lingkungan strategis dan telah dilakukan pemantauan otomatis/online oleh pimpinan organisasi?', 0, '2024-06-07 14:46:07', '2024-06-07 14:46:07');
INSERT INTO `tm_questions` VALUES (21, 5, '1. Apakah setiap pendelegasian wewenang di organisasi/ unit-organisasi/ unit kerja Saudara telah dilakukan secara formal dengan menerbitkan surat pendelegasian wewenang yang ditandatangani pejabat yang mendelegasikan wewenang?', 1, '2024-06-07 14:46:22', '2024-06-07 14:46:22');
