INSERT INTO `tm_questions` VALUES (23, 5, '3. Apakah setiap pendelegasiaan wewenang di unit organisasi/ unit kerja Saudara telah dilaksanakan dan melaporkan hasil pelaksanaan wewenang yang didelegasikan kepada pejabat yang mendelegasikan wewenang?', 1, '2024-06-07 14:46:53', '2024-06-07 14:46:53');
